import Header from "../header/header";

import "./app.css";

function App() {
  return (
    <div className="App">
      <div className="container">
        <Header />
        <Sort />
        <TransferCategory />
        <CompaniesCategory />
        <Tickets/>
      </div>
    </div>
  );
}

export default App;
